(1, 'Mil Capacity Building for Youth Organisations’ Leaders in Kenya', '06 Jun 2016', '6', '<p>The Centre for Media and Information Literacy in Kenya (CMIL-Kenya) and UNESCO have planned a 3-day media and information literacy (MIL) capacity building for membership-based youth-led organizations in Kenya to enhance their MIL competencies. The workshop will be held on October 17th&nbsp;&ndash; 19th, 2016 at Sunstar Hotel, Nairobi.</p>\r\n\r\n<p><strong>Specific Objectives:</strong></p>\r\n\r\n<ol>\r\n	<li>To conduct MIL capacity building to 30 young persons (15 men and 15 women) from diverse youth groups in tandem with UNESCO guidelines;</li>\r\n	<li>To assess the current levels of youth/citizen involvement and capacity of media and information literacy initiatives in Kenya, identify gaps and the best practices;</li>\r\n	<li>To develop guidelines and action plans for integration of MIL in the youth organizations&rsquo; mandates and activities.</li>\r\n</ol>\r\n\r\n<p>Please fill the PARTICIPATION FORM below and send it to&nbsp;<a href=\"mailto:medialiteracykenya@gmail.com\">medialiteracykenya@gmail.com</a>&nbsp;by COB on 16th&nbsp;September 2016. Only successfully assessed groups will be contacted. Organizers retain the right to determine the final short-list of participants.</p>\r\n', '4988590e7178ad6eea5dafc6c619492f58c4c102a1bca35e64edecbacb8a53cc75876ad3.png', '<p>The Centre for Media and Information Literacy in Kenya (CMIL-Kenya) and UNESCO have planned a 3-day media and information literacy (MIL) capacity building for membership-based youth-led organizations in Kenya to enhance their MIL competencies. The workshop will be held on October 17th&nbsp;&ndash; 19th, 2016 at Sunstar Hotel, Nairobi.</p>\r\n\r\n<p><strong>Specific Objectives:</strong></p>\r\n\r\n<ol>\r\n	<li>To c'),
(2, 'Introduction to Media Information Literacy', '05 Jul 2017', '6', '<p><strong>MEDIA &amp; INFORMATION LITERACY: A BRIEF INTRODUCTION</strong></p>\r\n\r\n<p>In the Digital Age, we find ourselves in, the media are in upheaval. Tremendous changes in the way information is packaged, received, retrieved, and shared have sparked fascination, confusion, and peril-especially when it comes to news, which is so essential in democracies (Clay Shirky, 2010).</p>\r\n\r\n<p>In this media turmoil which threatens our ability to oversee the people who act on our behalf, digital citizens of today&rsquo;s world need a media environment that serves us both as individuals and as a society; and acquire media and information literacy skills to enable us not just keep politicians in check but also to balance the power of the many other people and institutions we rely on, e.g. the police, doctors, technocrats, researchers, bankers, e.t.c., and all other people who make decisions that affect us without requiring or allowing our direct input. (ibid)</p>\r\n\r\n<p><strong>Defining Media &amp; Information Literacy</strong></p>\r\n\r\n<p>Media and Information Literacy (MIL) is used as a composite concept to refer to a set of competencies that empowers citizens to access, retrieve, understand, evaluate and use, create, as well as share information and media content in all formats, using various tools, in a critical, ethical and effective way, in order to participate and engage in personal, professional and societal activities.</p>\r\n\r\n<p>Media literate citizens can:<br />\r\na) access, find, evaluate, use the information they need in ethical and effective ways;<br />\r\nb) understand the role and functions of media and other information providers such as libraries, museums, and archives, including those on the Internet, in democratic societies and in the lives of individuals;<br />\r\nc) understand the conditions under which media and information providers can best fulfill their roles and functions;<br />\r\nd) critically evaluate information and media content from a variety of sources;<br />\r\ne) engage with media and information providers for self-expression, life-long learning, democratic participation, and good governance; and<br />\r\nf) enhance the skills (including ICT skills) needed to produce content in a variety of media formats.</p>\r\n\r\n<p>Media and Information Literacy (MIL) therefore brings together Information Literacy and Media Literacy, along with Information and Communication Technology (ICT) and Digital Literacy, as a new literacy construct that helps empower people, communities, and nations to participate in and contribute to global knowledge societies.<br />\r\n(Source: Unesco)</p>\r\n', '73cd1e1004ab04f4ef79b7438731f57dd116a3ca9a438d6ca3b62871c430f0bf1bc6ff1f.jpg', '<p><strong>MEDIA &amp; INFORMATION LITERACY: A BRIEF INTRODUCTION</strong></p>\r\n\r\n<p>In the Digital Age, we find ourselves in, the media are in upheaval. Tremendous changes in the way information is packaged, received, retrieved, and shared have sparked fascination, confusion, and peril-especially when it comes to news, which is so essential in democracies (Clay Shirky, 2010).</p>\r\n\r\n<p>In this media turmoi'),
(3, 'Incorporate Media & Information Literacy in Kenya’s New Curriculum', '05 Jul 2017', '6', '<p>A glaring omission in the proposed basic education curriculum framework which was presented to stakeholders for validation last month is the place of media and information literacy (MIL) for Kenyan students. The omission is strange given that the curriculum developing agency, KICD, works closely with UNESCO, who have dedicated substantial resources and research over the years and recommended that curricula the world over adopt media and information literacy as an inalienable competence for quality existence in the 21st-century knowledge societies.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Media and Information Literacy (MIL) is used as a composite concept to refer to a set of competencies that empowers citizens to access, retrieve, understand, evaluate and use, create, as well as share information and media content in all formats, using various tools, in a critical, ethical and effective way, in order to participate and engage in personal, professional and societal activities.</p>\r\n\r\n<p>More broadly, media and information literacy is a basis for enhancing access to information and knowledge, expression, and quality education. It describes skills, and attitudes that are needed to value the functions of media and other information providers, including those on the Internet, in societies and to find, evaluate and produce information and media content; in other words, it covers the competencies that are vital for people to be effectively engaged in all aspects of development (UNESCO).</p>\r\n\r\n<p>In a situation where the Kenya government is implementing a variety of cross-cutting initiatives that have a direct bearing on the lives of all citizens in the information age, it is envisaged that elaborate MIL initiatives are needed in Kenya to bring the various citizen groups &ndash; including children and youth &ndash; up to speed with the rapid development of digital technologies through media and information literacy awareness creation and capacity building.</p>\r\n\r\n<p>In this regard, the implementation of media and information literacy initiatives will help create a media-literate population in the country with the capacity and skills for access to quality information citizens need to make informed decisions within the new media and information environment. MIL will also equip citizens with skills to participate actively in governance and community development and be critical players to take advantage of the opportunities generated by the information age.</p>\r\n\r\n<p>Already, a number of state and non-state actors are undertaking various initiatives which fall squarely within the realms of media and information literacy. Aside from the Digital Literacy Programme spearheaded by Education and ICT ministries and their agencies, other initiatives include the media literacy public talk-shops organised by the Media Council of Kenya and the Film Classification Board&rsquo;s school visit programmes dubbed &ldquo;You Are What You Consume&rdquo; to sensitize students on film and media content safety and responsible Internet use. There cannot exist a better way to augment these disparate initiatives and rope in the future Kenyan citizen than integrating MIL into the new curriculum.</p>\r\n\r\n<p>It&rsquo;s noteworthy, however, that the envisaged core competencies in the new curriculum as recommended by the 2015 report &lsquo;Reforming Education and Training in Kenya&rsquo; are in congruence with MIL outcomes, notably communication and collaboration, critical thinking and creativity, citizenship and digital literacy. The curriculum developer may at this point want to adopt and contextualize for Kenyan children the UNESCO model (by far the most comprehensive) by expanding the now popular Digital Literacy Programme to encompass the entire spectrum including computer, Internet, Games, social networks, e.t.c., and other related literacies such as Media Literacy (Advertising, News, Television &amp; Cinema) and Information Literacy. Ways must also be found to incorporate the same in the training of teachers.</p>\r\n\r\n<p>This will however be difficult to implement given the current policy and strategy vacuum on media and information literacy implementation. There&rsquo;s therefore an urgent need for concerned authorities to start the process of drafting a National Media and Information Literacy Policy and Strategy for Kenya.</p>\r\n\r\n<p>Elaborate national MIL-related policies and strategies will guide the various initiatives and streamline the current and new efforts at all levels. The ongoing national education and curriculum reforms provide a perfect opportunity for this crucial activity, or we&rsquo;ll miss the bus, and time is nigh for stakeholder consultative forums on the same.</p>\r\n\r\n<p>If adopted, Kenya will join the few countries (around 70) that are implementing MIL-related activities in varying degrees and reach across the globe as more and more countries recognise the importance of MIL. The outcome will be an empowered people, communities and nations to be able to participate in and contribute to global knowledge societies.</p>\r\n\r\n<p>(The writer is a media and information literacy expert)</p>\r\n\r\n<p>Dated in Nairobi on 1st February 2017.<br />\r\nC/O<br />\r\nCENTRE FOR MEDIA &amp; INFORMATION LITERACY IN KENYA<br />\r\nP.O. BOX 76957 &ndash; 00620<br />\r\nNAIROBI.</p>\r\n', 'f3b9eff95d4c1fe3ab6c167c52b2d9f3fce325bc545fbf622c6481ca26f4c483c2fdc9fe.jpg', '<p>A glaring omission in the proposed basic education curriculum framework which was presented to stakeholders for validation last month is the place of media and information literacy (MIL) for Kenyan students. The omission is strange given that the curriculum developing agency, KICD, works closely with UNESCO, who have dedicated substantial resources and research over the years and recommended that curricu'),
(6, 'MIL Curriculum For Teachers Validation -(workshop)', '22 Oct 2019', '6', '<p>The draft MIL curriculum for teachers in Kenya was yesterday (on 6th&nbsp;September 2019) validated by stakeholders for adaptation and mainstreaming in teacher training and professional development in the country. Stakeholders drawn from government agencies, academia, the education sector, civil society, and the private sector hailed the draft curriculum as a timely resource for re-tooling the Kenyan teacher to deliver on the new competency-based curriculum being implemented in Kenya. The draft curriculum was extracted from the UNESCO MIL Curriculum for Teachers Guidelines and customized to local standards by the Centre for Media and Information Literacy in Kenya in consultation with the Kenya Institute of Curriculum Development (KICD).</p>\r\n\r\n<p>During the validation workshop held at KICD in Nairobi, the stakeholders encouraged the Kenya Institute of Curriculum Development to conduct a needs assessment for a further anchoring of MIL in teachers&#39; training. This call was led by Mrs. Purity Ngure, a teacher trainer and the current Principal of Muranga Teachers College who added that teachers need to be equipped with life skills including MIL competencies. Ms. Ngure noted that MIL is a necessary and critical life skill for both teachers and students in this era of fake information, disinformation, and fake news. She said that MIL skills will enable teachers to guide students to deal with media and other sources of information, adding that MIL has real value and needs to be mainstreamed in the education curriculum, not necessarily as an examinable subject.</p>\r\n\r\n<p>Another delegate, Mr. Kimani Charagu, a library information specialist trained in MIL noted that up to 2004, Library User Education was a taught unit in teacher training colleges before it was scrapped. He lauded the draft curriculum effort, noting that this would be the best chance to re-introduce the library user course in the teacher training, and called for an emphasis on the topic in the draft curriculum. Mr. Kimani said that MIL is critical for functional learning and would go a long way in protecting children online and in other forums. Mr. Kimani decried the low emphasis of children&rsquo;s literature in the education system and argued that MIL would do well to plug the gap.</p>\r\n\r\n<p>Mr. Ayub Mohamud, an award-winning teacher, and peace activist noted that MIL is recognized among the pedagogies that build resilience in students by conferring critical thinking abilities. Quoting from the UNESCO guide for policy-makers on preventing violent extremism through education, Mr. Mohamud said that MIL supports learners by encouraging them to scrutinize data, information, and media content that they interact with, and by providing them with the skills to create their own content for human rights, tolerance and a culture of peace.</p>\r\n\r\n<p>Dr. Jacinta Maweu of the University of Nairobi expressed her bias for critical thinking and said that it should be emphasized and come out clearly in the draft MIL curriculum. She noted that critical thinking is an intended outcome in the new curriculum in Kenya and said that mainstreaming MIL would go a long way to confer competence to teachers and students. Echoing the call for emphasis on critical thinking, filmmaker and media literacy trainer Mr. Ogova Ondego of Lola Films noted that MIL is important for civic education and teaching responsible citizenship. He urged the MIL curriculum writers to clearly separate the various forms of media for the student teachers, and stress the humanist values such as truth, tolerance, compassion, and respect.</p>\r\n\r\n<p>Media Council of Kenya representative Mr. Leo Mutisya called for a clear definition of terms to help separate media and information literacy from journalism, especially on the topic areas covering photojournalism and advertising. Mr. Mutisya informed the stakeholders that the Media Council of Kenya had also partnered with UNESCO to develop the MIL policy and strategy for Kenya, and the process was at an advanced stage.</p>\r\n\r\n<p>Finally, keynote speaker Prof. Muiru Ngugi of the University of Nairobi commended UNESCO, CMIL-Kenya, and the KICD team for coming up with the draft MIL curriculum for teachers. He also called for a clear definition of terms and the need to emphasize the benefits of public interest journalism in the curriculum on journalism and society. Prof. Ngugi also asked the MIL curriculum developers to treat social media as a topical area given its prevalence and potential as an educational tool.</p>\r\n\r\n<p>Participants expressed gratitude for the timeliness of the MIL curriculum for teachers&#39; discourse and called for intense lobbying to have it mainstreamed in teacher training once the final draft is developed.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '028bc6b8bada9a3731f7a0be3d7999d4a84fb56183f9125a4669f1badbc4f2e61308a31f.png', '<p>The draft MIL curriculum for teachers in Kenya was yesterday (on 6th&nbsp;September 2019) validated by stakeholders for adaptation and mainstreaming in teacher training and professional development in the country. Stakeholders drawn from government agencies, academia, the education sector, civil society, and the private sector hailed the draft curriculum as a timely resource for re-tooling the Kenyan tea'),
(7, 'Equip Teachers with Media Literacy Skills for CBC Delivery', '29 Oct 2019', '6', '<p><strong><em>By&nbsp; W. Gichunge:</em></strong></p>\r\n\r\n<p>As the world marked the International Literacy Day on September 8th, the expression that every educator &ndash;regardless of the subject area-is a teacher of reading comes to mind. After the ability to read and write (and numeracy) the traditional definition of literacy has since been expanded to include visual and information literacies, media literacy, critical thinking, and problem-solving skills, creativity, initiative, and self-direction. According to UNESCO, Media and information literacy is a critical 21st-century life skill to enable young people to understand the functions of media and other information providers and seek, evaluate, use and create information to achieve their personal, social, occupational, and educational goals. They must also possess basic skills for critical thinking, to analyze and use them for self-expression, for becoming independent learners, producers, informed citizens, professionals, and for participating in the governance and democratic processes of their societies.</p>\r\n\r\n<p>With the explosion of technology, the blitz of video gaming, social networking, and texting is daily bombarding students with information of all types, and in multiple ways and settings. Research has shown that today&rsquo;s students are less interested in reading textbooks and course material, and more interested in gathering information in a fast-paced, action-packed manner as they access all they need to know on phones, hand-held gadgets, tablets, or laptops posing a great challenge to the teacher who is expected to not only keep his young and adolescent not only interested in learning but is also held accountable for the student&rsquo;s success.</p>\r\n\r\n<p>In view of the above, the time to bring media and information literacy into the mainstream of the education system is now. The rolling out of the new curriculum is a watershed moment for Kenya to fully and proactively incorporate MIL in all its forms. Incorporating literacy skills into every lesson will have an impact on student engagement, retention, and lifelong learning. Media literacy scholar Renee Hobbs opines that full participation in contemporary culture requires not just consuming messages, but also creating and sharing them; and to fulfill the promise of digital citizenship, citizens must acquire multimedia communication skills that include the ability to compose messages using language, graphic design, images and sound, and know how to use these skills to engage in the civic life of their communities.</p>\r\n\r\n<p>The digital and media literacy competencies envisaged in the new curriculum are of enormous practical value since they constitute core competencies of citizenship in the digital age. People need digital skills to look for, access, store and create relevant information in order to apply for jobs, scholarships, etc. In Kenya, most government taxes have been automated including filing tax returns, applying for government documents like driving licenses, passports, and birth certificates. These competencies are necessary to become expert learners and lend credence to the growing momentum to support the integration of digital and media literacy into education.</p>\r\n\r\n<p>In Kenya, a number of initiatives have begun in earnest to entrench the implementation of media and information literacy implementation by government and civil society actors. One of the major initiatives in this regard is the customization of the UNESCO MIL Curriculum for Teachers Guidelines to local needs and standards for adaptation and possible mainstreaming in teacher training and continuous development programs.</p>\r\n\r\n<p>The main target group for the MIL curriculum is teachers, including at the primary, secondary and tertiary levels who are either in-training or in-service. The MIL curriculum is a tool specifically designed for teacher training institutions such as colleges and universities. The UNESCO MIL curriculum can also be adapted and used by other departments or institutes within a college or university for which MIL is a relevant field. The curriculum is also relevant to NGOs, government institutions and ministries, and other social organizations that offer various types of training and capacity building to citizens.</p>\r\n\r\n<p>Once formally implemented it is expected that the MIL curriculum will boost the teaching and learning process by equipping teachers with enhanced knowledge to empower future citizens. Finally, MIL will help to enhance education outcomes by equipping learners with the necessary competencies to participate fully in political, economic, and social life.</p>\r\n\r\n<p><em>*The writer is a media and information literacy expert</em></p>\r\n\r\n<p><em>Email: medialiteracykenya@gmail.com</em></p>\r\n', '96879918f0281fd6934ad8fcd97e338d56fdfb0631c4713987ccc2517cbfc6701413a081.jpg', '<p><strong><em>By&nbsp; W. Gichunge:</em></strong></p>\r\n\r\n<p>As the world marked the International Literacy Day on September 8th, the expression that every educator &ndash;regardless of the subject area-is a teacher of reading comes to mind. After the ability to read and write (and numeracy) the traditional definition of literacy has since been expanded to include visual and information literacies, media li'),
(8, 'Now is the Time for Global and Local Adaptation of Media and Information Literacy Initiatives', '25 Aug 2020', '6', '<p><strong><em>*By Mwongera G. Jakubu</em></strong></p>\r\n\r\n<p>If ever there was need to persuade anyone on the necessity for governments and citizens across the globe to actively provide, seek, acquire and practice media and information literacy skills and competences (recognised by UNESCO and experts as necessary and inalienable 21st&nbsp;Century survival-skills in the information age) then the COVID-19 pandemic has provided the most compelling of reasons.</p>\r\n\r\n<p>Sample this. Parallel to the spreading virus- which has ravaged the globe since December 2019, upsetting the world order in the process &ndash; is the information pandemic (also called&nbsp;<em>infodemic</em>) characterised mainly through misinformation and disinformation (or &ldquo;fake news&rdquo; in some quarters) and conspiracy theories- resulting in an unfortunate situation that has complicated the effective management of the virus amid an anxious global public that is desperate for factual, reliable and life-saving information.</p>\r\n\r\n<p>What&rsquo;s more &ndash; coronavirus has also visited formidable challenges across all sectors in the globe, exposing the soft underbelly of what individuals, countries, industries and enterprises had erroneously been used to as their comfort zones. The so-called &ldquo;new normal&rdquo; has put everyone and everything back to &ldquo;individual default settings&rdquo;, with most interactions and transactions taking place via technology. It has also upped the ante on conversations around various thematic issues related to media and information literacy such as Internet Connectivity, Digital Literacy, Freedom of Expression and Information, Access to Information, Online Child Safety, etc.</p>\r\n\r\n<p>One of the most affected sectors is the media and information. Prof. Jose Manuel Tornero, the UNESCO Chair for MIL for Quality Journalism has observed that the radical changes produced by digitisation have caused intense mediatisation of human life, which has allowed traditionally passive audiences to become active participants in the whole ecology of news and information production, storage, access, retrieval, sharing and dissemination. Journalists and media are no longer the sole players when it comes to producing and circulating information. Aided by technology, audiences are now able to produce their own content; and to create their own information networks within which they share news and occurrences deemed to be relevant within these networks; and are able to debate and express opinions and views with relative freedom and often without the need for mediation of legacy media.</p>\r\n\r\n<p>This shift has hit newsrooms and legacy media quite hard, and it has threatened journalists&rsquo; jobs and the viability of media as &ldquo;the business of truth&rdquo; which is crucial for democracy and sustainable development. However, the media are and will remain key actors in today&rsquo;s world; therefore they need to understand the change and develop the capacity to assess and respond to these and other risks and challenges through innovation.</p>\r\n\r\n<p>One of the recommended ways is for the media, governments and citizens to embrace media and information literacy (MIL) in their daily operations. As UNESCO has observed, without language, there is no humanity, without journalism, there is no democracy and development, and without MIL, there is no democratic human conversation.</p>\r\n\r\n<p>While media and information literacy addresses the application of critical thinking by audiences while consuming news and information, not placing the burden of responsibility on the consumer of information and instead making the mechanisms behind the production of information clear and transparent is increasingly becoming a new role of the media in this regard.</p>\r\n\r\n<p>Quality journalism infused with MIL will lead to citizens&rsquo; quality participation in the public conversation and restore public trust in the legacy media while sustaining the cardinal principles of the truth through the media in a world inundated with information and news overload. To achieve this, media and information skills and competences need to be enhanced and disseminated equitably among all citizens.</p>\r\n\r\n<p>In this regard, UNESCO and the Global Alliance for Media and Information Literacy (GAPMIL) has been promoting the training of journalists, policy makers and citizens on media and information literacy in order to sustain the building of this new and useful social conversation.</p>\r\n\r\n<p>Kenya is one of the few countries in the world where MIL interventions have been on an upward trend, thanks to UNESCO support. One such training targeting media practitioners, regulators and stakeholders will be held on August 25-27, with the aim of improving the quality of journalism, and for promoting the enhancement of MIL in the country.</p>\r\n\r\n<p><em>*The writer is a communications and media &amp; information literacy (MIL) trainer and consultant.</em></p>\r\n\r\n<p><em>Email: medialiteracykenya@gmail.com</em></p>\r\n', 'ee552ac36723215aafddadc41a9eba0375eb253a1e8fa0243f4c6c5c326edb1e870f6bf7.jpg', '<p><strong><em>*By Mwongera G. Jakubu</em></strong></p>\r\n\r\n<p>If ever there was need to persuade anyone on the necessity for governments and citizens across the globe to actively provide, seek, acquire and practice media and information literacy skills and competences (recognised by UNESCO and experts as necessary and inalienable 21st&nbsp;Century survival-skills in the information age) then the COVID-19 pa'),
(9, 'UNESCO MIL Alliance Kenya Chapter', '04 Aug 2021', '16', '<p><strong>INSTITUTIONAL MEDIA AND INFORMATION LITERACY INITIATIVES WILL HELP COUNTER DISINFORMATION AND HATE SPEECH</strong></p>\r\n\r\n<p><strong>By W. M. Gichunge*</strong></p>\r\n\r\n<p>For ages, false and misleading information has been used to create fear, restrict rights and disrupt democratic processes, observed UNESCO Director-General Ms. Audrey Azouley in her remarks during the 2020 Global Media and Information Literacy Conference, underscoring the complexity of today&rsquo;s information environment where news and information are ubiquitous and can be shared instantly around the world. A cursory look at what happens for one minute on the Internet is simply mind-boggling. Today, anyone can create and distribute content, expressing themselves in ways they never could before. In some cases, this has created an overflow of information &ndash; both online and offline &ndash;where it is increasingly difficult for citizens to know what to believe and who to trust, creating potentially devastating implications for democracy, sustainable development and peace.</p>\r\n\r\n<p>Technological advancement in the information and communication sector has heralded one of the most challenging aspects in the 21st Century Information Age &ndash; Disinformation and Misinformation. Pundits have observed that alongside the spread of COVID-19 around the world has an overflow of rumors and false information in what has the World Health Organisation (WHO) described as a <em>disinfodemic</em>. In these times of a global pandemic whose end is not yet predictable, citizens access to reliable and factual information means the difference between life and death. Unfortunately, there&rsquo;s a worryingly big chunk of misleading and outrightly false information on the coronavirus especially on social media and messaging platforms. This portends a global crisis because, as has been noted by scholars, disinformation can have a strong and negative impact on public opinion, and people&#39;s decision-making about social, health or political-economic issues. This scenario exacerbates in times of a crisis such as the COVID-19 pandemic. Consequently, it hinders people&#39;s participation in democratic processes, inclusive governance, and the achievement of the Sustainable Development Goals, among other societal aspirations.</p>\r\n\r\n<p>On the political front, the social media platforms and usage are reshaping much of political communication in Africa and the globe, setting up new rules, winners and losers. As such, they are changing the way political parties and candidates campaign for public office; how they raise funds, mobilize support and establish and maintain relationships with the electorate; and how they fight their adversaries. Likewise, social media is changing the way people communicate, gather news and participate in political processes. Therefore, social media is fundamentally changing the conduct of political campaigns and elections (Ndlela &amp; Mano, 2021). As Kenya enters into an election year with the general elections slated for August 2022, a heightened online and offline political discourse is imminent, and with it the attendant downsides such as circulation of rumors, hate speech, unsubstantiated claims, falsehoods and fake news. If allowed to thrive unabated, this phenomenon can undermine the democratic process and lead to misinformed choices, or worse, electoral violence.</p>\r\n\r\n<p>From the foregoing, UNESCO has recommended that one of the strongest defenses against false and misleading information as well as hate speech is media and information literacy. This involves building the resilience of individuals, communities and societies through a combination of soft and hard skills: including critical thinking to evaluate messages and understand the ethics of digital technology; coding and other competencies to create and use technological solutions to solve social challenges. Media and information literacy is also treated as a prerequisite for individuals, communities and societies to enjoy and exercise their universal human rights and fundamental freedoms, in particular; access to information, freedom of expression and the right to education. MIL is equally important for the existence of good governance, accountability and transparency for economic and societal development (UNESCO, 2013b).</p>\r\n\r\n<p>Towards this end, UNESCO and global partners launched the Media and Information Literacy Week a decade ago to help spread MIL skills through networks, dialogue, advocacy, awareness creation and holding cross-cutting thematic activities at local, regional and international levels. In November 2019, UNESCO&rsquo;s Member States made this event official to acknowledge the importance of MIL as a tool for development and proclaimed the Global Media and Information Literacy Week at its General Conference. In 2020, the Global MIL Week focused on the theme <em>&ldquo;Resisting the Disinfodemic: Media and Information Literacy for Everyone by Everyone&rdquo;</em>. This was in recognition that citizen&rsquo;s ability to access and critically assess information is crucial &ndash; not only to save lives but also to avoid falling into the trap of misinformation and disinformation. In addition to developing educational resources for social media, UNESCO updated the MIL Curriculum for Teachers, in consultation with MIL experts, teachers, and information and media professionals, to ensure that students across the globe are able to keep up with the rapid technological transformations of communication and information. Preparations for the 2021 Global MIL Week are underway, under the theme <em>&ldquo;Media and Information Literacy for the Public Good.&rdquo;</em> The Conference will be hosted by South Africa during the last week of October 2021.</p>\r\n\r\n<p>Further, to spearhead the MIL agenda, UNESCO has recommended the establishment of alliances and partnerships comprising a variety of MIL actors to be created both locally and internationally to ensure information and knowledge exchange between civil society actors, regulators, government ministries, and international bodies with respect to MIL. This is in tandem with the UNESCO Media Information Literacy Alliance Strategy to form regional and National Chapters to act as networks for MIL initiatives.</p>\r\n\r\n<p>The Centre for Media and Information Literacy (CMIL)-Kenya has partnered with UNESCO and other government and non-government players in media regulation, development, academic, civil society, and youth organizations to formulate the Kenya Chapter of the UNESCO MIL Alliance. The Alliance, set to be launched in August is expected to consolidate the gains realized from the MIL initiatives across the country, and keep up the momentum in the journey towards the stated goal of MIL for All by All.</p>\r\n\r\n<p>This will ensure that Kenyan citizens are empowered with media and information literacy (MIL) competencies and are able to distinguish disinformation from truthful information; are able to proactively use social media platforms as well as gainfully participate in political and other citizen discourses, among other MIL benefits.</p>\r\n\r\n<p><strong><em>*The Writer is a Media Literacy Expert and Director, CMIL-Kenya</em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', '02b1f9d1e89ae112c92962d3ad3973002dad5abb4c72dea5f461b93a6393c8e0f4893e1e.jpg', '<p><strong>INSTITUTIONAL MEDIA AND INFORMATION LITERACY INITIATIVES WILL HELP COUNTER DISINFORMATION AND HATE SPEECH</strong></p>\r\n\r\n<p><strong>By W. M. Gichunge*</strong></p>\r\n\r\n<p>For ages, false and misleading information has been used to create fear, restrict rights and disrupt democratic processes, observed UNESCO Director-General Ms. Audrey Azouley in her remarks during the 2020 Global Media and Infor');
