INSERT INTO `home` (`id`, `head`, `content`) VALUES
(1, 'Who We Are', 'The Centre for Media & Information Literacy in Kenya (CMILKenya) is a not-for-profit organization registered in Kenya in May, 2013 to spearhead media and information literacy among various citizen groups and promote good governance through civic engagement initiatives in the country.'),
(2, 'What We Do', 'CMIL-Kenya empowers Kenyan citizens to fully utilize their constitutionally guaranteed freedom of expression and access to information by demanding and using responsible and accurate information from relevant sources to enable them actively and positively participate in public governance processes.');
