INSERT INTO `mil` (`id`, `head`, `content`, `p1`, `p2`, `p3`, `p4`) VALUES
(3, 'Defining Media & Information Literacy', '<p>Media and Information Literacy (MIL) is used as a composite concept to refer to a set of competencies that empowers citizens to access, retrieve, understand, evaluate and use, create, as well as share information and media content in all formats, using various tools, in a critical, ethical and effective way, in order to participate and engage in personal, professional and societal activities.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'e8e6e8f8091ffb7b4f46d6dc40b107a1d3d86f56894129cc843db7a1dcf79995d3f951ff.jpg', '', '', ''),
(4, 'Media literate citizens can:', '<ul>\r\n	<li>access, find, evaluate, use the information they need in ethical and effective ways;</li>\r\n	<li>understand the role and functions of media and other information providers such as libraries, museums and archives, including those on the Internet, in democratic societies and in the lives of individuals;</li>\r\n	<li>understand the conditions under which media and information providers can best fulfill their roles and functions;</li>\r\n	<li>critically evaluate information and media content from a variety of sources;</li>\r\n	<li>engage with media and information providers for self-expression, life-long learning, democratic participation, and good governance; and</li>\r\n	<li>enhance the skills (including ICT skills) needed to produce content in a variety of media formats.</li>\r\n</ul>\r\n\r\n<p>Media and Information Literacy (MIL) therefore brings together Information Literacy and Media Literacy, along with Information and Communication Technology (ICT) and Digital Literacy, as a new literacy construct that helps empower people, communities, and nations to participate in and contribute to global knowledge societies.</p>\r\n\r\n<p>(Source: Unesco)</p>\r\n', '16032f1a266495f09af335d38d259eeefde24e23ef02a2fdde902b7cdc326f92b130014d.jpg', '', '', '');
INSERT INTO `mil2` (`id`, `head`, `content`) VALUES
(3, 'The citizens of the 21st Century', '<p>The citizens of the 21st Century live in a digital, connected and media saturated world mainly experienced through digital technology. The proliferation of mass media and new technologies has brought about decisive changes in human communication processes and behaviour. With the Digital Age already arrived in Africa and the rest of the world, digitization has provided new and exciting ways to access and share information and knowledge; but only for some, with substantive swathes of the population especially in the rural areas still unable to tap from the opportunities of free expression and participation in conversations that affect their lives.</p>\r\n\r\n<p>The nexus between information, media and citizenship can be illustrated in the backdrop of major societal trends where knowledge and how it is communicated to others play a central role in shaping economic growth, social development, cultural enrichment, political empowerment and the consolidation of democratic systems. At the global level, UNESCO promotes the concept of knowledge societies which are inclusive, pluralistic, equitable and participatory based on four major principles: equal access to quality education for all; universal access to information; cultural and linguistic diversity; and freedom of expression.</p>\r\n\r\n<p>Media and information literacy skills are therefore essential building blocks for creation of knowledge societies that includes dimensions of social, cultural, economic, political and institutional transformation. Knowledge is also an important resource for economic growth and for empowering and developing all sectors of society.</p>\r\n'),
(4, 'Kenya Vision 2030', '<p>In Kenya, the economic blueprint of Vision 2030 aspires to a period of economic growth with improved quality of life in the country. Central to this status is the development of a knowledge economy that will be driven by media and new technologies which present unprecedented opportunities for far wider participation by Kenyans in the national and global discourse.</p>\r\n\r\n<p>It is therefore imperative that elaborate MIL initiatives are taken to bring the various citizen groups up to speed with the rapid development of digital technologies through media and information literacy. Media Literacy will create a media literate and informed population among Kenyan citizens with capacity for access to, understanding and production of the new media environment. It will also arm them with skills to participate in governance as active and critical citizens able to take advantage of the opportunities generated in the Information Age. To paraphrase UNESCO, the measurement of MIL is a must for any country that wishes to promote and develop the knowledge societies of its citizens.</p>\r\n\r\n<p>It is against this background that the Centre for Media and Information Literacy in Kenya (CMIL-Kenya) was founded to spearhead the uptake of media and information literacy among various citizen groups in Kenya and promote public participation in governance processes through civic engagement initiatives.<br />\r\nCMIL-Kenya has partnered with UNESCO and other global organizations to midwife these MIL interventions in light of globalisation and the explosion of ICTs in the country.</p>\r\n'),
(5, 'Defining MIL', '<p>Media and Information Literacy (MIL) is used as a composite concept to refer to a set of competencies that empowers citizens to access, retrieve, understand, evaluate and use, create, as well as share information and media content in all formats, using various tools, in a critical, ethical and effective way, in order to participate and engage in personal, professional and societal activities.</p>\r\n\r\n<p>Media literate citizens can access, find, evaluate, use the information they need in ethical and effective ways; understand the role and functions of media and other information providers such as libraries, museums and archives, including those on the Internet, in democratic societies and in the lives of individuals; understand the conditions under which media and information providers can fulfill their functions; critically evaluate information and media content; engage with media and information providers for self-expression, life-long learning, democratic participation, and good governance; and updated skills (including ICT skills) needed to produce content.</p>\r\n\r\n<p>Media and Information Literacy (MIL) brings together Information Literacy and Media Literacy, along with Information and Communication Technology (ICT) and Digital Literacy, as a new literacy construct that helps empower people, communities and nations to participate in and contribute to global knowledge societies</p>\r\n\r\n<p>UNESCO and other MIL protagonists hold that media and information literacy (MIL) is essential to empower citizenries all around the world to have full benefits of fundamental human rights and freedoms as well as enable sound social discourse. It also enables citizens to be aware of their responsibilities in the context of these freedoms, which include the responsibility to demand quality media and information services and to use information and technology ethically. This is very much in tune with&nbsp;<strong>Goal 16 of the SDGs</strong>&nbsp;which reads as, &lsquo;Promote peaceful and inclusive societies for sustainable development, provide access to justice for all and build effective, accountable, and inclusive institutions at all levels.&rsquo; MIL empowers citizens, including children and youth, with competencies related to media, information, ICT, and other aspects of literacy that are needed for 21st-century existence.</p>\r\n\r\n<p>Once implemented, media and information literacy (MIL) aims to empower citizens by providing them with the competencies- which include knowledge, skills and attitudes- necessary to gainfully engage within the plethora of media and information sources and outlets. MIL includes the following elements or learning outcomes:</p>\r\n\r\n<ul>\r\n	<li>Understanding the role and functions of media in democratic societies;</li>\r\n	<li>Understanding the conditions under which media can fulfill their functions;</li>\r\n	<li>Critically evaluate media content as active consumers;</li>\r\n	<li>Engage with media for self-expression and democratic participation; and</li>\r\n	<li>Review skills (including ICTs skills) needed to produce user-generated content.</li>\r\n</ul>\r\n\r\n<p>Faced with the choice between privacy and safety on the Internet, between freely expressing themselves and ethically use information, the media and technology &ndash; women, men, and young boys and girls need new types of competencies.</p>\r\n\r\n<p>Media and information literacy (MIL) offers these competencies. Education for all must therefore include media and information literacy for all.</p>\r\n\r\n<p>Additional source:&nbsp;<a href=\"http://www.unesco.org/new/en/communication-and-information/media-development/media-literacy/\">http://www.unesco.org/new/en/communication-and-information/media-development/media-literacy/</a></p>\r\n');
INSERT INTO `mil_africa` (`id`, `head`, `content`, `photo`) VALUES
(2, 'By Chido Onumah & Olunifesi Suraj', '<h3><strong>Introduction</strong></h3>\r\n\r\n<p>Information rules the world today. More often than not, the type of information we receive affects our choices, our relationship with others, the quality of life we live, the kind of influence we have on others, the extent to which others influence us, the kinds of activities we undertake and the roles we decide to play in society as citizens and participants in the democratic process.</p>\r\n\r\n<p>While Article 19 of the Universal Declaration of Human Rights talks about everyone&rsquo;s &ldquo;right to freedom of opinion and expression,&rdquo; it is important, according to UNESCO, to equip citizens with competencies needed to seek and enjoy the full benefits of this fundamental human right. Media and Information Literacy (MIL) as a field of engagement provides citizens with the requisite competencies for the realization of their rights.</p>\r\n\r\n<p><img alt=\"\" src=\"http://medialiteracy-kenya.info/admin/includes/gallery/12fa5f186de4600da1f03f5218de0d204e912b1183b28279306127f853ade236e684d878.jpeg\" style=\"float:right; width:50%\" /></p>\r\n\r\n<p><strong>Why Media &amp; Information Literacy (MIL)?</strong></p>\r\n\r\n<p>Media and Information Literacy (MIL) competencies are important because they assist teachers, parents, educators, students and youth, etc., to become agents of social change and enhance intercultural dialogue and understanding.</p>\r\n\r\n<p>The EU-funded UNESCO MIL project in southeast Europe and Turkey &ldquo;seeks to strengthen freedom of expression, access to information, free, independent and pluralistic media, ensuring that journalists and media are key drivers for democratic, sustainable and peaceful development in the region,&rdquo; notes that, &ldquo;At the heart of media and information&nbsp;literacy lies the need to empower citizens with essential knowledge&nbsp;about the functions of media and information systems in democratic societies,&nbsp;under what conditions these functions can be performed and how citizens&nbsp;can evaluate the quality of the content they provide.&rdquo;</p>\r\n\r\n<p>A media and information literate citizen is one who can analyze, evaluate and create messages in a wide variety of media modes, genres, and forms. Because we are daily faced with diverse and overwhelming information, in some cases in unfiltered formats, in other times deliberately skewed to misinform, MIL has become an essential tool for social understanding and cohesion.</p>\r\n\r\n<p><strong>Social media and new media technologies</strong></p>\r\n\r\n<p>One of the challenges we are confronted with as we try to explore the frontiers of MIL is the place of social media and new media technologies. Social Media is a radical departure from media as we have known it. Social Media enables wider participation; it is interactive; it gives media users the opportunity to share information, videos, and pictures, sometimes in real-time.</p>\r\n\r\n<p>The expansion of new media technologies has led to the rise of social media platforms&mdash;like Facebook, Twitter, Instagram and YouTube&mdash;and apps that young people have exploited, sometimes for good and sometimes for malicious activities. Young people are increasingly taking advantage of the power of social media to interact as well as share knowledge and information.</p>\r\n\r\n<p>MIL experts and enthusiasts are interested in understanding the kinds of impact social media have on the way young people communicate and relate to people from different social, political, cultural and religious backgrounds. This understanding will offer greater opportunities for new types of citizens&rsquo; engagement, centered on freedoms and eradicating inequalities. It will also help address issues of safety, security, privacy, violence, stereotyping, gender, etc.</p>\r\n\r\n<h3><strong>Critical thinking and intercultural dialogue skills</strong></h3>\r\n\r\n<p>MIL emphasizes critical thinking and intercultural dialogue skills about accessing information and the media as well as understanding media messages. Information is key to our understanding of the world around us and the way news and information is delivered and accessed can have a bearing on how&nbsp;we interpret and incorporate the news and information.</p>\r\n\r\n<p>Critical thinking and intercultural dialogue skills help citizens overcome the vulnerability associated with the use of Social Media. The explosion of different life-altering apps and websites that can distort reality or present &ldquo;alternative facts&rdquo; is a clear and present danger and a challenge for those seeking to identify reliable sources of information. It is, therefore, critical that young people, as well as all citizens, have the skills and develop the ability to identify these apps and websites.</p>\r\n\r\n<p><strong>Verification and the deepfake phenomenon</strong></p>\r\n\r\n<p>Given that most people access the Internet privately and a lot of the content available is often not verified by an independent source and can be manipulated, it is important that Internet users understand how to distinguish what is factual from what is biased, inaccurate or fake. &ldquo;Fake news&rdquo; is a global phenomenon that has blossomed with the rise of Social Media. In today&rsquo;s post-truth world, it is not out of place to see those willing to propagate falsehood create disinformation to support their lie, while those caught with inappropriate behavior write off the evidence of their bad behavior even with more disinformation</p>\r\n\r\n<p>Currently, a lot of made-up news stories and fake videos featuring prominent politicians litter social media. Obviously, people do not just share content because they believe it, they do it for a host of other reasons. Purveyors of &ldquo;fake news&rdquo; seek to distort reality for fame, financial considerations or even for sinister motives. For instance, studies have shown that creating and sharing false or misleading information is often rewarded on platforms like Facebook. Unfortunately, these fake contents find their way into the mainstream media. Himma-Kadakas, Marju writing in the July 2017 edition of Cosmopolitan Civil Societies: An Interdisciplinary Journal, notes that fake news which often reverberates as&nbsp;<a href=\"https://en.wikipedia.org/wiki/Misinformation\">misinformation</a>&nbsp;in social media occasionally finds its way to the mainstream media as well.</p>\r\n\r\n<p>With the recent faked video of Mark Zuckerberg, co-founder of Facebook, on Instagram, the &ldquo;drunk Pelosi&rdquo; video, and the deceptively edited video of President Trump&rsquo;s speech from the Oval Office, we seem to have entered into the next level of the post-truth era in which &ldquo;deepfake&rdquo;&mdash;the new phenomenon of human image synthesis based on artificial intelligence&mdash;is now in the ascendancy.</p>\r\n\r\n<p>Many technology researchers and scholars are of the strong opinion that deepfakes&mdash;realistic-looking content developed using machine learning algorithms&mdash;and cheap fake&mdash;modifying video content slightly to create a false reality&mdash;will herald a new era of information warfare. There is a need, therefore, for governments, journalists, politicians, media practitioners, academics and other citizens to be concerned about the technological sophistication of artificial intelligence&ndash;generated deepfakes because not only is it dangerous to democracy, it often renders evidence meaningless.</p>\r\n\r\n<p>Cheap fake, it has been noted, is already calling into question the methods of evidence that scientists, courts, and newsrooms traditionally use to call for accountability. Hence, the need to emphasize the ethical use of information, technology and media, especially on social media platforms since cheap fakes rely on free editing software that allows digital manipulation as well as nontechnical manipulations of content and footage that are crisis-prone.</p>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>We can help young people to stay out of harm&rsquo;s way by empowering and educating them on how to avoid or manage risks related to Internet use. More importantly, the looming threat of deepfake and cheap fake is worth the attention, especially from the undiscerning audience who might be victims.</p>\r\n\r\n<p>There is a need to inform and educate citizens on Artificial Intelligence, algorithms and potential threats of deepfake technology while also bearing in mind that disinformation does not have to be high tech to cause serious societal damage.</p>\r\n\r\n<p>Citizens also need to be aware of the different social media platform moderation policies on posted content since different platforms have varying verification and tolerance for faked content. Ethical use of information, technology and media should be a priority educational need in today&rsquo;s post-truth world where truth is becoming a scarce commodity.</p>\r\n\r\n<p><strong><em>Chido Onumah, Ph.D. is Coordinator, African Centre for Media &amp; Information Literacy, Abuja, Nigeria.&nbsp;</em></strong><strong><em>Olunifesi Suraj, Ph.D. is UNESCO National Coordinator, Media &amp; Information Literacy (Nigerian Chapter) and Senior Lecturer, Dept. of Mass Communication, University of Lagos, Nigeria.</em></strong></p>\r\n', '12fa5f186de4600da1f03f5218de0d204e912b1183b28279306127f853ade236e684d878.jpeg');
INSERT INTO `mil_resources` (`id`, `head`, `content`, `photo`) VALUES
(2, 'AFRICA EDUCATION MINISTERS ADOPT INTEGRATION OF MEDIA & INFORMATION LITERACY AT PACE-2018 CONFERENCE', '<p>The Pan-African High-Level Conference on Education (#PACE2018), was held by UNESCO in collaboration with the African Union and the Government of Kenya on 25-29 April 2018 in Nairobi, Kenya, with the theme &ldquo;Bridging Continental and Global Education Frameworks for the African We Want&rdquo;.</p>\r\n', 'c4a8701aace81ceb790c8008f80019287866dfe0e8ed098b6ab3eb6d8b3655e4d636d270.jpg'),
(3, 'AFRICA EDUCATION MINISTERS ADOPT INTEGRATION OF MEDIA & INFORMATION LITERACY AT PACE-2018 CONFERENCE', '<p>CMIL-Kenya participated in the conference where Executive Director Wallace Gichunge made a presentation on media literacy as a tool for ensuring internet safety in schools. &ldquo;In using the Internet in a safe way, a new set of literacies are needed to address the multitude of communication media in the wake of proliferating and emergent technologies,&rdquo; said Mr. Gichunge. He concluded that as countries in Sub-Saharan Africa undertake reforms of their education systems in response to global trends and the use of the Internet, it is important to mainstream media and information literacy to achieve the desired increase in the quality of schooling, and more critically, higher learning outcomes.</p>\r\n\r\n<p>At the end of the conference, the Ministers of Education in Africa adopted the recommendation for the integration of media and information literacy (MIL) within curricula and education policies in the ensuing Nairobi Declaration and Call for Action on Education.</p>\r\n', 'd625602fce0d88b485a9624219d986df387c076ce8ed098b6ab3eb6d8b3655e4d636d270.jpg');
INSERT INTO `news` (`id`, `head`, `content`, `photo`, `date`, `preview`, `month`, `year`) VALUES
(4, 'Global Media and Information Literacy Week 2017', '<p>CMIL-KENYA TO PARTICIPATE IN THE GLOBAL MIL WEEK CELEBRATIONS IN JAMAICA CMIL-Kenya Executive Director has been invited to participate, as a speaker, to the Global Media and Information Literacy (MIL) Week feature conference, namely, the Seventh Media and Information Literacy &amp; Intercultural Dialogue (MILID) Conference, to be held from 24 to 27 October 2017 in [&hellip;]</p>\r\n', 'c2f264497c08b51f75fcb80433e1227139d9ebe72ae3a51874e07d00708b90f80f344142.png', '27', '<p>CMIL-KENYA TO PARTICIPATE IN THE GLOBAL MIL WEEK CELEBRATIONS IN JAMAICA CMIL-Kenya Executive Director has been invi', 'Jul', '2017'),
(5, 'The upcoming National MIL Policy & Strategy event', '<p>The upcoming National MIL Policy &amp; Strategy event</p>\r\n', '1aba7e74b0ce7bc31b7a186ae85fd9fcc68781829d1b8757a954cf96265bc98cfa4ea845.jpg', '04', 'The upcoming National MIL Policy & Strategy event', 'Aug', '2017'),
(6, '(MIL) Curriculum For Teachers Validation-(workshop)', '<p>The draft MIL curriculum for teachers in Kenya was yesterday (on 6th September 2019) validated by stakeholders for adaptation and mainstreaming in teacher training and professional development in the country. Stakeholders drawn from government agencies, academia, education sector, civil society, and the private sector hailed the draft curriculum as a timely resource for re-tooling the [&hellip;]</p>\r\n', '2e7e506c5be2937619e0663695a316c28b2da72a90951769e3de664bfe3891ea0a7e94c5.png', '19', '<p>The draft MIL curriculum for teachers in Kenya was yesterday (on 6th September 2019) validated by stakeholders for a', 'Sept', '2020'),
(7, 'UNESCO SUPPORTS CENTRE FOR MIL TO CONDUCT TRAINING WORKSHOP', '<p>The Centre for Media and Information Literacy in Kenya (CMIL-Kenya) has partnered with the Communications Authority of Kenya (CA) through the support of UNESCO to conduct a capacity-building workshop of media professionals, practitioners and regulators on media and information literacy (MIL) in Kenya. The online workshop titled &ldquo;Strengthening Capacities of Media Practitioners and Regulatory Bodies [...]</p>\r\n', '2f902c4370b8d789660ac4eb2552c280a1a65c40cf713f2be49295de9af7e079af6c22fa.png', '20', '<p>The Centre for Media and Information Literacy in Kenya (CMIL-Kenya) has partnered with the Communications Authority ', 'Jul', '2021'),
(8, 'UNESCO MIL Alliance Kenya Chapter', '<p>INSTITUTIONAL MEDIA AND INFORMATION LITERACY INITIATIVES WILL HELP COUNTER DISINFORMATION AND HATE SPEECH</p>\r\n\r\n<p><strong>INSTITUTIONAL MEDIA AND INFORMATION LITERACY INITIATIVES WILL HELP COUNTER DISINFORMATION AND HATE SPEECH</strong></p>\r\n\r\n<p><strong>By W. M. Gichunge*</strong></p>\r\n\r\n<p><strong>For ages, false and misleading information has been used to create fear, restrict rights and disrupt democratic processes, observed UNESCO Director-General Ms. Audrey Azouley in her remarks during the 2020 Global Media and Information Literacy Conference, underscoring the complexity of today&rsquo;s information environment where news and information are ubiquitous and can be shared instantly around the world. A cursory look at what happens for one minute on the Internet is simply mind-boggling. Today, anyone can create and distribute content, expressing themselves in ways they never could before. In some cases, this has created an overflow of information &ndash; both online and offline &ndash;where it is increasingly difficult for citizens to know what to believe and who to trust, creating potentially devastating implications for democracy, sustainable development and peace.</strong></p>\r\n\r\n<p><strong>Technological advancement in the information and communication sector has heralded one of the most challenging aspects in the 21st Century Information Age &ndash; Disinformation and Misinformation. Pundits have observed that alongside the spread of COVID-19 around the world has an overflow of rumors and false information in what has the World Health Organisation (WHO) described as a <em>disinfodemic</em>. In these times of a global pandemic whose end is not yet predictable, citizens access to reliable and factual information means the difference between life and death. Unfortunately, there&rsquo;s a worryingly big chunk of misleading and outrightly false information on the coronavirus especially on social media and messaging platforms. This portends a global crisis because, as has been noted by scholars, disinformation can have a strong and negative impact on public opinion, and people&#39;s decision-making about social, health or political-economic issues. This scenario exacerbates in times of a crisis such as the COVID-19 pandemic. Consequently, it hinders people&#39;s participation in democratic processes, inclusive governance, and the achievement of the Sustainable Development Goals, among other societal aspirations.</strong></p>\r\n\r\n<p><strong>On the political front, the social media platforms and usage are reshaping much of political communication in Africa and the globe, setting up new rules, winners and losers. As such, they are changing the way political parties and candidates campaign for public office; how they raise funds, mobilize support and establish and maintain relationships with the electorate; and how they fight their adversaries. Likewise, social media is changing the way people communicate, gather news and participate in political processes. Therefore, social media is fundamentally changing the conduct of political campaigns and elections (Ndlela &amp; Mano, 2021). As Kenya enters into an election year with the general elections slated for August 2022, a heightened online and offline political discourse is imminent, and with it the attendant downsides such as circulation of rumors, hate speech, unsubstantiated claims, falsehoods and fake news. If allowed to thrive unabated, this phenomenon can undermine the democratic process and lead to misinformed choices, or worse, electoral violence.</strong></p>\r\n\r\n<p><strong>From the foregoing, UNESCO has recommended that one of the strongest defenses against false and misleading information as well as hate speech is media and information literacy. This involves building the resilience of individuals, communities and societies through a combination of soft and hard skills: including critical thinking to evaluate messages and understand the ethics of digital technology; coding and other competencies to create and use technological solutions to solve social challenges. Media and information literacy is also treated as a prerequisite for individuals, communities and societies to enjoy and exercise their universal human rights and fundamental freedoms, in particular; access to information, freedom of expression and the right to education. MIL is equally important for the existence of good governance, accountability and transparency for economic and societal development (UNESCO, 2013b).</strong></p>\r\n\r\n<p><strong>Towards this end, UNESCO and global partners launched the Media and Information Literacy Week a decade ago to help spread MIL skills through networks, dialogue, advocacy, awareness creation and holding cross-cutting thematic activities at local, regional and international levels. In November 2019, UNESCO&rsquo;s Member States made this event official to acknowledge the importance of MIL as a tool for development and proclaimed the Global Media and Information Literacy Week at its General Conference. In 2020, the Global MIL Week focused on the theme <em>&ldquo;Resisting the Disinfodemic: Media and Information Literacy for Everyone by Everyone&rdquo;</em>. This was in recognition that citizen&rsquo;s ability to access and critically assess information is crucial &ndash; not only to save lives but also to avoid falling into the trap of misinformation and disinformation. In addition to developing educational resources for social media, UNESCO updated the MIL Curriculum for Teachers, in consultation with MIL experts, teachers, and information and media professionals, to ensure that students across the globe are able to keep up with the rapid technological transformations of communication and information. Preparations for the 2021 Global MIL Week are underway, under the theme <em>&ldquo;Media and Information Literacy for the Public Good.&rdquo;</em> The Conference will be hosted by South Africa during the last week of October 2021.</strong></p>\r\n\r\n<p><strong>Further, to spearhead the MIL agenda, UNESCO has recommended the establishment of alliances and partnerships comprising a variety of MIL actors to be created both locally and internationally to ensure information and knowledge exchange between civil society actors, regulators, government ministries, and international bodies with respect to MIL. This is in tandem with the UNESCO Media Information Literacy Alliance Strategy to form regional and National Chapters to act as networks for MIL initiatives.</strong></p>\r\n\r\n<p><strong>The Centre for Media and Information Literacy (CMIL)-Kenya has partnered with UNESCO and other government and non-government players in media regulation, development, academic, civil society, and youth organizations to formulate the Kenya Chapter of the UNESCO MIL Alliance. The Alliance, set to be launched in August is expected to consolidate the gains realized from the MIL initiatives across the country, and keep up the momentum in the journey towards the stated goal of MIL for All by All.</strong></p>\r\n\r\n<p><strong>This will ensure that Kenyan citizens are empowered with media and information literacy (MIL) competencies and are able to distinguish disinformation from truthful information; are able to proactively use social media platforms as well as gainfully participate in political and other citizen discourses, among other MIL benefits.</strong></p>\r\n\r\n<p><strong><em>*The Writer is a Media Literacy Expert and Director, CMIL-Kenya</em></strong></p>\r\n', '0ae3389fd7dac8ba5e5578d670d385f583f1d36ba32ccb2ed0f2d6d9f14410f7f32899f4.jpg', '24', '<p>INSTITUTIONAL MEDIA AND INFORMATION LITERACY INITIATIVES WILL HELP COUNTER DISINFORMATION AND HATE SPEECH</p>\r\n\r\n<p>', 'Aug', '2021'),
(9, 'UNESCO Media and Information Literacy Alliance Members', '<p>Dear UNESCO Media and Information Literacy Alliance Members,</p>\r\n\r\n<p>Let us celebrate together. Register your local events now!</p>\r\n\r\n<p>Global Media and Information Literacy Week 2021</p>\r\n\r\n<p>24-31 October</p>\r\n\r\n<p><strong>Theme:</strong> <strong>Media and Information Literacy for the Public Good</strong></p>\r\n\r\n<p>USEFUL LINKS</p>\r\n\r\n<p>âž¤ Official website</p>\r\n\r\n<p>âž¤ Register your celebration events</p>\r\n\r\n<p>âž¤ Register for the Feature Conference and Youth Agenda Forum</p>\r\n\r\n<p>âž¤ Feature Conference agenda outline</p>\r\n\r\n<p>âž¤ Organizing committees</p>\r\n\r\n<p><strong>DESCRIPTION</strong></p>\r\n\r\n<p>Global Media and Information Literacy Week 2021 will be commemorated from 24 to 31 October 2021, under the theme &ldquo;Media and Information Literacy for the Public Good&rdquo;. It will be hosted by South Africa.</p>\r\n\r\n<p>All stakeholders are invited to organize online and offline local events/actions to observe the Week worldwide. Registered events will be showcased on the Global MIL Week website.</p>\r\n\r\n<p>&gt;&gt; Register your local events here:<a href=\"https://https://en.unesco.org/globalmilweek/2021/registration\" target=\"_blank\"> https://en.unesco.org/globalmilweek/2021/registration</a>.</p>\r\n\r\n<p>The highlights of this year&rsquo;s Global MIL Week will include the traditional feature events, namely the Feature Conference and Youth Agenda Forum, which will take place online and gather policymakers, experts, practitioners, researchers, international organizations, NGOs, and private sector organizations from around the globe.</p>\r\n\r\n<p>&nbsp;&gt;&gt; Register for the feature events here: <a href=\"https://en.unesco.org/globalmilweek/2021/featureconference/registration\" target=\"_blank\">https://en.unesco.org/globalmilweek/2021/featureconference/registration</a>.<br />\r\nFor more information about Global Media and Information Literacy Week 2021, please see the attached concept note and visit the official website: <a href=\"https://en.unesco.org/commemorations/globalmilweek\" target=\"_blank\">https://en.unesco.org/commemorations/globalmilweek</a>.<br />\r\nKindest regards,</p>\r\n\r\n<p>Alton</p>\r\n\r\n<p><a href=\"http://en.unesco.org/themes/media-and-information-literacy\" target=\"_blank\">Alton Grizzle</a></p>\r\n\r\n<p>Programme Specialist &ndash; Section for Media and Information Literacy and Media Development / Section pour l&rsquo;&eacute;ducation aux m&eacute;dias et a l&rsquo;information et d&eacute;veloppement des m&eacute;dias,</p>\r\n\r\n<p>Communication and Information Sector, UNESCO, Paris &ndash; Phone: +33.1.4568.0890</p>\r\n', '37cda45660e74d626e137d4b34d7a235bca25028910a7f56332317c7c0ff1dbd6f48d864.png', '12', '<p>Dear UNESCO Media and Information Literacy Alliance Members,</p>\r\n\r\n<p>Let us celebrate together. Register your loca', 'Sep', '2021'),
(10, 'Global Media and Information Literacy Youth Hackathon', '<p>Global Media and Information Literacy Youth Hackathon led by UNESCO and South Africa in cooperation with European Commission<br />\r\nDear UNESCO Partners,<br />\r\n&nbsp;<br />\r\nPlease share widely with your networks.<br />\r\n&nbsp;<br />\r\nWhat can youth do to harness Media and Information Literacy to build the post-pandemic world for the public good?<br />\r\nHack Media and Information Literacy for Better Futures &ndash; a Global Youth Hackathon led by UNESCO and South Africa, in cooperation with European Commission, IBM Z, and other partners, will seek to answer this question. In partnership with the EU-funded project Social Media 4 Peace, this year&rsquo;s edition seeks to tackle the specific challenges in promoting peace-building narratives and to address hate speech through media and information literacy. The call for applications is now launched globally.<br />\r\nApply as a team: click here<br />\r\nDeadline: 3 October 2021, at 00:00 Paris time</p>\r\n\r\n<p>About Global Media and Information Literacy Week 2021<br />\r\nThe annual Global Media and Information Literacy Week, initiated in 2012, is led by UNESCO in cooperation with the UNESCO Media and Information Literacy Alliance, the UNESCO-UNAOC MIL, and Intercultural Dialogue (MILID) University Network, and other partners. It is a major occasion for stakeholders to review and celebrate the progress achieved towards &ldquo;Media and Information Literacy for All&rdquo; and a UN international Day.<br />\r\nThe tenth Global Media and Information Literacy Week will be commemorated from 25th to 29tht October 2021 and will be hosted by South Africa. Global Media and Information Literacy Week 2021 highlights will include the eleventh MIL and Intercultural Dialogue Conference and the sixth Youth Agenda Forum.<br />\r\nMore information</p>\r\n', 'a97546a9eb1345cf520b9479fc9099cb34e5ddfb302ef4a479c3ef69cb1c91f37f996d0b.jpg', '22', '<p>Global Media and Information Literacy Youth Hackathon led by UNESCO and South Africa in cooperation with European Co', 'Sep', '2021');
