(3, 'Prof. Sam Chege', 'Sam Chege Mwangi is an Assistant Professor at the A.Q. Miller School of Journalism and Mass Communication at Kansas State University. He holds a Ph.D. in Journalism and Mass Communications from the University of South Carolina, a Master of Arts degree in development communication from the University of Iowa, and a Bachelor of Arts degree from the University of Nairobi, Kenya, in English Literature and Political Science. He has served as a resident fellow at the Kettering Foundation researching media and civic engagement. His research interests are in media and civic engagement, new media technologies, and development communication.', 'aa97f4ff1b8aab2c396e440112b5e28bfcf1963f2d6f7ca48bddd2a40a75fd8abb36e217.png'),
