INSERT INTO `what_we_do` (`id`, `head`, `content`) VALUES
(3, 'Introduction:', 'CMIL-Kenya acts as a think tank and focuses its activities on media and information literacy advocacy, access to information and civic engagement for development and improved governance through research, workshops, training, curriculum development, round-tables and awareness creation involving experts, local and external partners, and media; and has created valuable partnerships with local and international players in the furtherance of media and information literacy initiatives in Kenya.'),
(4, 'Our Programme Areas', '<ul>\r\n<li>Introduction and Consolidation of MIL activities in Kenya.</li>\r\n<li>Conducting MIL Research, Baseline Surveys and Consultancy.</li>\r\n<li>Coordinating Development of National MIL Policy and Strategy.</li>\r\n<li>MIL Capacity Building for various Citizen Groups.</li>\r\n<li>Forging National, Regional and International Partnerships for MIL Development in Kenya</li>\r\n</ul>'),
(5, 'Activities', '<ul>\r\n<li>Implementing the Kenya Media and Information Literacy Project in Consultation with Partners.</li>\r\n<li>Capacity Building for Youth Organizations on Media and Information Literacy.</li>\r\n<li>Conducting Media and Information Literacy Baseline Surveys and Research.</li>\r\n<li>Convening National MIL Consultative Meetings and Round-tables.</li>\r\n<li>Undertaking Media and Information Literacy Awareness Creation.</li>\r\n<li>Implementing Civic Engagement and Public Participation activities.</li>\r\n</ul>');
