INSERT INTO `who_we_are` (`id`, `head`, `content`) VALUES
(1, 'Mission', '<p><strong>Empowering Kenyan and African citizens with MIL skills to fully utilize their right to freedom of expression and access to information by seeking accurate information from a variety of sources to enable them to make informed judgments as users of information and media, and actively participate in the governance and development process.</strong></p>\r\n'),
(2, 'Vision', '<p><strong>&lsquo;A media literate and actively engaged citizenry in Kenya, Africa and beyond&rsquo;</strong></p>\r\n'),
(3, 'Core Values', '<p><strong>CML-Kenya is guided by the core values of professionalism, accountability, integrity, and respect for diversity in the conduct of its business.</strong></p>\r\n'),
(4, 'Background', '<p><strong>The Centre for Media &amp; Information Literacy in Kenya (CMILKenya) is a not-for-profit organization registered in Kenya in May 2013 to spearhead media and information literacy among various citizen groups and promote good governance through civic engagement initiatives in the country.</strong></p>\r\n\r\n<p><strong>CMIL-Kenya is registered by the NGOï¿½s Coordination Board under certificate No. 0P. 218/051/13-0110/8890</strong></p>\r\n'),
(5, 'Our Mandate', '<p><strong>The overall aim of CMIL-Kenya is to spearhead the uptake of media and information literacy skills for all citizens in the country - a critical skill the 21st-century knowledge societies - through research, capacity building, and advocacy for the provision and dissemination of adequate and quality information from the government, media and other sources, and for gainful use of the information by citizens for growth of democracy and development in Kenya.</strong></p>\r\n'),
(6, 'MIL Programme\'s Main Objectives', '<ul>\r\n	<li>CMIL-Kenya plays a leading role in the coordination and implementation of various MIL initiatives for the uptake of MIL skills among various citizen groups in Kenya, Africa, and beyond to promote access to quality information, good governance, public participation, peacebuilding, civic engagement, gender empowerment and intercultural dialogue among other MIL outcomes.</li>\r\n	<li>The Centre&rsquo;s p strives to play a leading PART in the nurturing of global citizens in Kenya and Africa equipped with the essential 21st Century media and information literacy skills for participatory democracy and development.</li>\r\n</ul>\r\n'),
(7, 'Operation Status', '<p><strong>CMIL-Kenya is set up as a media &amp; information literacy think-tank and operates as a National NGO with International Partnerships and Collaborations. The Centre is based in Nairobi and has been authorized to initially operate Counties representing urban, peri-urban, and rural demographic settings. The Centre however plans to roll out its MIL programs in the whole country and African region in the future. CML-Kenya is politically neutral and does not subscribe to any political leanings.</strong></p>\r\n'),
(8, 'CMIL-Kenya MIL PART', '<p>We play our MIL Part as follows:</p>\r\n\r\n<ol>\r\n	<li><span class=\"marker\"><strong>P</strong></span>artnerships; (Unesco, DW Akademie, regional players in Africa, etc)</li>\r\n	<li><span class=\"marker\"><strong>A</strong></span>dvocacy; (With AU, Kenya Govt)</li>\r\n	<li><strong><span class=\"marker\">R</span></strong>esearch/<strong><span class=\"marker\">R</span></strong>esource Development; and (MIL Curriculum/Research in EA)</li>\r\n	<li><span class=\"marker\"><strong>T</strong></span>raining/Capacity Building (Training events for youth &amp; media practitioners)</li>\r\n</ol>\r\n'),
(9, 'Envisaged Activities', '<ol>\r\n	<li>Fostering local, regional &amp; international MIL Partnerships</li>\r\n	<li>Conducting Baseline Surveys and thematic research undertakings</li>\r\n	<li>National &amp; County MIL Consultative Meetings and round-tables</li>\r\n	<li>Organize Media and Information Literacy workshops &amp; conferences</li>\r\n	<li>Capacity Building of policymakers, youth organizations, teachers on Media and Information Literacy</li>\r\n	<li>Civic Engagement on public interest issues</li>\r\n</ol>\r\n'),
(10, 'Partnerships', '<ol>\r\n	<li>UNESCO (Paris &amp; Nairobi)</li>\r\n	<li>Global Alliance &amp; Partnerships on Media &amp; Information Literacy (GAPMIL)</li>\r\n	<li>African Centre for Media &amp; Information Literacy (AFRIMIL)</li>\r\n	<li>Pan African Alliance on Media &amp; Information Literacy (PAMIL)</li>\r\n	<li>Media Council of Kenya</li>\r\n	<li>Ministry of Education, Science &amp; Technology</li>\r\n	<li>Kenya Institute of Curriculum Development</li>\r\n	<li>Kenya Education Management Institute</li>\r\n	<li>McGill University, Canada</li>\r\n	<li>Riara University, Kenya</li>\r\n	<li>University of Boras, Sweden</li>\r\n	<li>Athabasca University, Canada</li>\r\n</ol>\r\n');
